import { useState } from "react";
import Layout from "../components/layout/layout";

function Dashboard() {
  const [index, setIndex] = useState(null);
  const position = { topbar: "flex gap-5" };
  const design = { topbar: "font-medium" };

  return (
    <Layout>
      <div className={`${position.topbar} ${design.topbar}`}>
        <p onClick={() => setIndex(1)}>Profile</p>
        <p onClick={() => setIndex(2)}>Inbox</p>
        <p onClick={() => setIndex(3)}>Orders</p>
        <p onClick={() => setIndex(4)}>Favourites</p>
        <p onClick={() => setIndex(5)}>Settings</p>
      </div>
    </Layout>
  );
}

export default Dashboard;
